{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/michaelbergerson/bellabeat-case-study?scriptVersionId=91252953\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"e29e8fa9","metadata":{"papermill":{"duration":0.0643,"end_time":"2022-03-25T21:32:20.758749","exception":false,"start_time":"2022-03-25T21:32:20.694449","status":"completed"},"tags":[]},"source":["# Table of Contents\n","\n","* [Introduction](#Introduction)\n","* [Data Cleaning](#Cleaning)\n","* [Analysis](#Analysis)\n","* [Conclusion](#Conclusion)\n"]},{"cell_type":"markdown","id":"f91237a1","metadata":{"papermill":{"duration":0.060014,"end_time":"2022-03-25T21:32:20.878441","exception":false,"start_time":"2022-03-25T21:32:20.818427","status":"completed"},"tags":[]},"source":["<a id=\"Introduction\"></a>\n","# Introduction\n","\n","## Ask\n","**Identify the business task**\n","\n","What are some trends in smart device usage that can apply to Bellabeat customers and help influence Bellabeat marketing strategy?\n","\n","**Consider key stakeholders**\n","\n"," * Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n"," * Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","\n","## Prepare\n","**Data**\n","\n","[FitBit Fitness Tracker Data](http://www.kaggle.com/arashnic/fitbit) on Kaggle\n","CC0: Public Domain\n","Description: These datasets were generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences\n","\n","# Findings\n","\n","One key finding is that when looking at sedentary minutes versus total minutes asleep, it shows that there is a negative corelation with total minutes asleep starting at 500 minutes. Another key finding is that both active minutes and total distance are positively correlated with calorie intake. Other variables had weak or no correlation with each other.\n","\n","**What are some trends in smart device usage that can apply to Bellabeat customers and help influence Bellabeat marketing strategy?**\n","\n","One direction Bellabeat marketing team could go is to say over eight hours a day of being sedentary has a negative effect on sleep quality and Bellabeat can help remind you to move. I certainly have been guilty of being too sendentary and I think that reminders to move would be helpful. Bellabeat's marketing team could also market towards people who are more active. Bellabeat could say that being active typically increases calories consumed and that Bellabeat can help people track those calories. It would also be good to say that Bellabeat help track calories on less active days, for those trying to lose or maintain weight."]},{"cell_type":"code","execution_count":1,"id":"9fbb6bbb","metadata":{"execution":{"iopub.execute_input":"2022-03-25T21:32:21.008482Z","iopub.status.busy":"2022-03-25T21:32:21.003409Z","iopub.status.idle":"2022-03-25T21:32:22.300296Z","shell.execute_reply":"2022-03-25T21:32:22.29905Z"},"papermill":{"duration":1.361559,"end_time":"2022-03-25T21:32:22.30049","exception":false,"start_time":"2022-03-25T21:32:20.938931","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[3