t customers and help influence Bellabeat marketing strategy?**\n","\n","One direction Bellabeat marketing team could go is to say over eight hours a day of being sedentary has a negative effect on sleep quality and Bellabeat can help remind you to move. I certainly have been guilty of being too sendentary and I think that reminders to move would be helpful. Bellabeat's marketing team could also market towards people who are more active. Bellabeat could say that being active typically increases calories consumed and that Bellabeat can help people track those calories. It would also be good to say that Bellabeat help track calories on less active days, for those trying to lose or maintain weight.\n","\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":12.827191,"end_time":"2022-03-25T21:32:30.310205","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-25T21:32:17.483014","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}